import React from "react";

const Services = () => {
  return (
    <>
      <div className="my-5">
        <h1 className="tab-center"> Our Services </h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <div></div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
